import React from 'react';

const Card = ({ professor } ) => {
    return(
        <div className='tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
            <div>
                <h2>{professor.name}</h2>
                <p>{professor.coursenumber}</p>
                <p>{professor.easiness}</p>
                <p>{professor.contents}</p>
                <p>Received grade {professor.grade}</p>
                <p>Book needed? {professor.book}</p>
                <p>Attendance needed? {professor.attendance}</p>
                <p>Class style looks like: {professor.classstyle}</p>
                <p>{professor.comments}</p>
            </div>
        </div>
    );
}

export default Card;
